import Providers from "./Providers";
import {
    BaseCSS,
    GridThemeProvider,
    Container,
    Row,
    Col
} from "styled-bootstrap-grid";
import { FaShoppingCart } from "react-icons/fa";

import { ImgPrint } from "./components/ImgPrint";
import Button from "./components/Button";
import Price from "./components/Price";
import Header from "./components/Header";
import Select from "react-select";

const sizes = [
    { value: "12x18", label: "12x18cm" },
    { value: "16x24", label: "16x24cm" },
    { value: "20x30", label: "20x30cm" },
    { value: "24x36", label: "24x36cm" },
    { value: "36x48", label: "36x48cm" },
    { value: "50x75", label: "50x75cm" }
];

const papers = [
    { value: "matte", label: "matte" },
    { value: "glossy", label: "glossy" },
    { value: "satin", label: "satin" }
];

const customCSS = `
  html {
    font-size: 1em;
    @media (min-width: 769px){
      font-size: 1.125em;
    }
  }
  body { 
    margin: 0;
    padding: 4.5rem 0 1.5rem;
    font-family: Montserrat, sans-serif;
    line-height: 1.5rem;
    background-color: #FCF9F4;
  }
  h1, h2, h3, h4, h5, h6, p, button {
    margin-top: 0;
    margin-bottom: 1.5rem;
    line-height: 1.5rem;
  }
  
  h1 {
    line-height: 2.25rem;
    margin-bottom: 0;
  }

  h2 {
    margin-top: 2.25rem;
  }

  h3 {
    margin-top: 1.5rem;
  }

  img {
    display: block;
    max-width: 100%;
    height: auto;
  }
`;

const customGrid = {
    breakpoints: {
        xl: 1400
    },
    container: {
        maxWidth: {
            xl: 1340
        }
    }
};

class ProductPage extends Component {
    render() {
        return (
            <Providers>
                <GridThemeProvider gridTheme={customGrid}>
                    <BaseCSS css={customCSS} />
                    <Header />
                    <Container>
                        <Row>
                            <Col>
                                <h1>The Coast of Dorset, UK</h1>
                                <p>
                                    by{" "}
                                    <a href="https://unsplash.com/@whoisbenjamin">@whoisbenjamin</a>
                                </p>
                            </Col>
                        </Row>
                        <Row>
                            <Col
                                md={7}
                                style={{
                                    display: "flex",
                                    justifyContent: "center",
                                    alignItems: "flex-start"
                                }}
                            >
                                <ImgPrint
                                    src="https://images.unsplash.com/photo-1575976371069-bf1d39f2fd21?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=2734&q=80"
                                    alt=""
                                />
                            </Col>
                            <Col md={5}>
                                <Price price="€12.99" />

                                <label htmlFor="sizes">Select size</label>
                                <Select
                                    name="sizes"
                                    defaultValue={sizes[0]}
                                    options={sizes}
                                    styles={{
                                        control: styles => ({
                                            ...styles,
                                            marginBottom: "1.5rem",
                                            height: "2.25rem"
                                        })
                                    }}
                                />

                                <label htmlFor="papers">Select paper</label>
                                <Select
                                    name="sizes"
                                    defaultValue={papers[0]}
                                    options={papers}
                                    styles={{
                                        control: styles => ({
                                            ...styles,
                                            marginBottom: "1.5rem",
                                            height: "2.25rem"
                                        })
                                    }}
                                />

                                <div style={{ display: "flex", justifyContent: "center" }}>
                                    <Button
                                        type="button"
                                        label="Add to cart"
                                        icon={<FaShoppingCart />}
                                    />
                                </div>

                                <h2>Product details</h2>
                                <div>
                                    <strong>Border : </strong>white border on all sides
                                </div>
                                <div style={{ marginBottom: "1.5rem" }}>
                                    <strong>Processing time : </strong>1-2 business days in lab +
                                    shipping
                                </div>
                                <p>
                                    <em>
                                        Please note : poster paper is not glossy and is thinner than
                                        photographic paper used for photo prints, do not heat mount
                                        posters.
                                    </em>
                                </p>
                            </Col>
                        </Row>
                    </Container>
                </GridThemeProvider>
            </Providers>
        );
    }
}

export default ProductPage;
